 cultural_festival.2100.desc: "„Spójrz na to!” Słyszę, idąc ulicami [ROOT.Char.GetCurrentLocation.GetTitle.GetAdjectiveNoTooltip]. [ROOT.Char.Custom2('MySheHe', SCOPE.sC('inspired_courtier'))|U] [ROOT.Char.Custom2('RelationToMeShort', SCOPE.sC('inspired_courtier'))] [inspired_courtier.GetFirstName] wskazuje na coś, co wydaje się być znane jako [guild_location.Custom('GetGuildType')] [guild_location.GetCounty.GetFaith.WealthGodNamePossessive]; na [inspired_courtier.GetHerHis] twarzy szybko pojawia się błogi uśmiech.\n\nGrupa czeladników klęczy przed stołem warsztatowym. Majster nadzoruje pracę z nadproża drzwi, ze skrzyżowanymi ramionami i uniesionym podbródkiem. „Będziesz potrzebować do tego trochę więcej siły, synu”.\n\n[inspired_courtier.GetFirstName] robi krok w ich kierunku, całkowicie zahipnotyzowan[Select_CString(inspired_courtier.IsFemale, 'a', 'y' )]."
